import React from "react";
import "./ContentQuestion.css";

function ContentQuestion() {
  return (
    <div>
      {/* <Navbar /> */}
      <header className="ex-header">
        <div className="container">
          <div className="row">
            <div className="col-xl-10 offset-xl-1">
              <h1 className="text-center">Chi tiết câu hỏi</h1>
            </div>
          </div>
        </div>
      </header>
      <div className="content-question-container">
        <div
          className="breadcrumb"
          style={{ backgroundColor: "#fff", padding: "20px" }}
        >
          <i className="fa fas fa-home">Trang chủ / PHP Cơ bản / Q 1</i>
        </div>
        <hr
          style={{ width: "1000px", marginLeft: "auto", marginRight: "auto" }}
        ></hr>
        <div className="main-content">
          <div className="title-question">
            <h3>Sự khác biệt của Axios và Fetch?</h3>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ContentQuestion;
